import { useEffect, useState } from "react";
import Card from "./Card";
import axios from "axios";

const Home = () => {
    const [imgsArr, setImg] = useState([]);
    useEffect(() => {
        async function getData() {
            const response = await axios.get(
                "https://api.themoviedb.org/3/movie/popular/?api_key=692ad17fefe3f279a5bc0dfa87752845"
            );
            const imgArr = response.data.results;
            setImg(imgArr);
            console.log(imgsArr);
        }
        getData();
    }, []);

    return (
        <div className="container mt-5">
            <div className="row">
                {imgsArr.map((img) => {
                    const literallyImg = img.poster_path;
                    return (
                        <Card
                            image={
                                "https://image.tmdb.org/t/p/w500" + literallyImg
                            }
                        ></Card>
                    );
                })}
            </div>
        </div>
    );
};

export default Home;
